import Paper from "@material-ui/core/Paper";

import ProfileStyles from "../styles/Profile.module.scss";

const styles = {
  MuiPaper: {
    display: "flex",
    alignItems: "center",
    position: "absolute",
    top: 162,
    left: 23,
    right: 23,
    height: 128,
    backgroundColor: "rgba(26, 120, 194, 1)",
    padding: 40,
    boxSizing: "border-box",
    borderRadius: 10,
  },
  AccountIcon: {
    width: 80,
    height: 80,
  },
};

export default function Profile() {
  return (
    <section className={ProfileStyles.Form}>
      <Paper style={styles.MuiPaper}>
        <section className={ProfileStyles.MainInfo}></section>
        <div className={`${ProfileStyles.UserIcon} UserIcon`} />
        <p className={ProfileStyles.UserName}>Иванова Анна Михайловна</p>
        <div className={ProfileStyles.Close}>
          <p>Закрыть </p>
          <img
            src="/cross.png"
            className={ProfileStyles.CloseImg}
            alt="close"
          />
        </div>
      </Paper>
    </section>
  );
}
